INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES (1, 0, 11, 14314, 0.5, "わぁっ、この誕生日ケーキ……！\nみんなで作ってくれたさ～？\nこんなでっかいケーキ、\n見たことないさー！", 0, 14314063, 10, 101711, 1);
