INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES (1, 0, 11, 27814, 0.5, "お、お誕生日\nおめでとうございます、クウカさん。\nせ、せっかく、ケーキを用意したので、\nみんなでこれを食べませんか……？", 0, 27814078, 10, 105511, 1);
