INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES (1, 0, 11, 34314, 0.5, "ついにこの日がやってきたの～！\n今日はミヤコの誕生日なんだから、\n山のようにプリンを用意して、\n盛大にお祝いするの～♪", 0, 34314071, 10, 100711, 1);
