INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES (1, 0, 11, 38014, 0.5, "私からは本をプレゼントするわ。\nタイトルは「猫でもできる節約術」よ。\n日々の倹約に役立ててちょうだい。", 0, 38014068, 10, 104811, 1);
